import React, { Fragment } from 'react';
import { Route, useParams } from 'react-router-dom';


const QuoteDetails = () => {
    const params = useParams();
    return (
        <Fragment>
            <h1>Quote Detail Page</h1>
            <p>{params.quoteId}</p>
            <Route path='/quotes/{params.quoteId}/comments'>

            </Route>
        </Fragment>
    );
}

export default QuoteDetails;
